import React from 'react';
import Fullname from './Fullname'
import Gender from './Gender';
import Age from './Age';

function Output() {
  return (
    <div>
      <form>
        <fieldset>
          <legend>สมัครสมาชิก</legend>
            <Fullname/>
            <Gender/>
            <Age/>
        </fieldset>
      </form>
    </div>
  )
}

export default Output;
